INSERT INTO `ustream_milestones` VALUES (3,'d-iZeさん最後の出演','d-iZeさん最後の出演<br><br>\r\n\r\n2014年3月に卒業されましたがUstreamLiveへの出演は2014年1月が最後でした。','43068972','2014-12-24 09:47:14','2015-10-29 10:41:27'),(5,'PlayYou.House始動','PlayYou.House始動<br><br>PlayYou.House（プレイユーハウス）とはソニーのウォークマン『Play You.』プロジェクトによりスタートしたシェアハウスです。Goosehouseの前身となるユニットグループですね。','7761148','2015-01-08 10:32:11','2015-10-29 10:43:14'),(6,'まなみさん初登場','まなみさん初登場<br><br>\r\n\r\n初々しさがあって今とは違うまなみさんを垣間みれます♫<br><br>\r\n\r\nちなみに、この時に木村くんが着ていたパーカーは、後に2012年12月のHOY放送でゲスト出演した際に着ていたものと同じではないかというツイートが読まれてオドオドしたリアクションが良いですね。','17613040','2015-01-08 10:37:06','2015-10-29 10:43:53'),(7,'PlayYou.House 2nd 始動','1ヶ月のリフレッシュ期間を経て2ndシーズンに入ったPlayYou.House!!Ustream Liveの放送時間も30分遅くなり今となってはおなじみの20時からになりました。','9950624','2015-01-12 03:08:49','2015-10-29 10:44:42'),(8,'Goosehouse スタート！！','Goosehouse スタート！！<br><br>\r\n\r\nソニーの“ウォークマン”「Play You.」企画が終了したことからGoosehouseとして再始動しました！','14539684','2015-01-12 03:15:51','2015-10-29 10:45:07'),(9,'さやかさん初登場','さやかさん初登場<br><br>実はアーティストとして音楽活動をおこなうのはGoosehouseでの活動が初めてだということです。','17889327','2015-01-12 03:26:55','2015-10-29 10:45:35'),(10,'齊藤ジョニーさん卒業','後に復帰しますが、齊藤ジョニーさんは一度Goosehouseを卒業していました。','22862395','2015-01-12 03:59:23','2015-10-29 10:47:26'),(11,'ワタナベシュウヘイさん初登場','ワタナベシュウヘイさん初登場<br><br>初めましてとは思えない今と変わらないパワフルなわしゅうです。','23505881','2015-01-12 04:00:34','2015-10-29 10:47:48'),(12,'神田莉緒香さん卒業','神田莉緒香さん卒業<br><br>\r\n放送内で突然の卒業発表でした。その後、2013年HOY放送でゲスト出演しました。<br><br>\r\n\r\n<a href=\"http://goosetune.tv/search/ustream/41941980\" target=\"_blank\">2013年HOY</a>','29848622','2015-01-12 04:02:31','2015-10-29 10:55:25'),(13,'齊藤ジョニーさん復帰','齊藤ジョニーさん復帰<br><br>\r\n\r\n2012年5月をもってGoosehouseを卒業された齊藤ジョニーさんが復帰されました。一発目に演奏したcome againがHOYを受賞しました。\r\n\r\n<a href=\"http://goosetune.tv/search/youtube/p5mFAYUxjnw\" target=\"_blank\">come again／m-flo</a>','31709859','2015-01-12 04:05:58','2015-10-29 10:56:09'),(14,'中村千尋さん初登場','中村千尋さん初登場','9950624','2015-01-12 12:27:24','2015-10-29 10:51:13'),(15,'竹澤汀さん初登場','竹澤汀さん初登場','9950624','2015-01-12 12:27:38','2015-10-29 10:50:51'),(17,'木村正英さん卒業','木村正英さん卒業<br><br>\r\nその後、2012年12月のHOY放送でゲスト出演し、Singを演奏した姿は忘れられません。<br><br>\r\n\r\n<a href=\"http://goosetune.tv/search/ustream/27732716\" target=\"_blank\">Goosehouse UST LIVE 2012 HOY</a>','19048707','2015-01-16 09:07:25','2015-10-29 10:53:40'),(18,'中村千尋さん最後の出演','中村千尋さん最後の出演<br><br>\r\n\r\n当時は\"卒業\"という形はなく、2011年1月15日のUstream放送でメンバーからPlayYou.Houseでの活動を一時退室するという発表がありました。<br><br>\r\n\r\n<a href=\"http://goosetune.tv/search/ustream/12027283\" target=\"_blank\">2011年1月15日のUstream放送</a>\r\n','11115542','2015-01-16 09:13:34','2015-10-29 11:00:46'),(19,'関取花さん最後の出演','関取花さん最後の出演<br><br>\r\n\r\n当時は\"卒業\"という形はなく、2ndシーズン1回目の放送でメンバーから不参加が伝えられました。<br><br>\r\n\r\n<a href=\"http://goosetune.tv/search/ustream/9950624\" target=\"_blank\">2ndシーズン1回目</a>','9059475','2015-01-16 09:28:16','2015-10-29 10:59:03');
