INSERT INTO `ustream_witticisms` VALUES (2,'ペソ','山崎まさよしさんの『中華料理』演奏終了後に、『演奏から戻ったわしゅうが冷房を要望！に１００万ペソ』というツイートが読まれたことで話題になりました。','36103009','2015-02-12 00:09:33','2015-10-29 11:03:05','00:50:55'),(3,'代官山のあしやしょてんさん','猫のプシュケの絵本発売記念に代官山蔦屋書店にて開催されたイベントに際して、慶ちゃんが言い間違えたとてもかわいいワンシーンです！<br>\r\n<br>\r\n言い間違えをこうやって取り上げるのは良くないのかもしれませんが、d-iZe兄さんとの『俺よく行くんだよぉ、気まずいだろぉ』といったやり取り含めて大好きなんで紹介します♫','36103009','2015-02-12 10:29:26','2015-10-29 11:03:37','00:17:55'),(4,'やっぱ誰かが単体で補えるものではないんでね。やっぱみんなでやるのが礼儀だろうなと。','2014年12月放送であるHOY2014にて、いきものがかりさんの『笑顔』を演奏後、d-iZe兄さんのソロパートを全員で歌ったことに対してのジョニーさんのコメントです。<br>\r\n<br>\r\nとてもホッコリするし、みんなが本当にd-iZe兄さんを慕い尊敬してるんだと感じれる言葉だと思います☆','56683384','2015-02-12 10:46:19','2015-10-29 11:05:01','00:54:00'),(5,'これがシグナルクォリティー','この時のUstream放送1発目、BENNIE Kさんの『Dreamland』を演奏したのはユニットグループ『signal』の3人！<br>\r\n<br>\r\n音を重ね録りする機材『ループステーション』の録音タイミングに工藤さんのボイパが合わずに生演奏でのやり直しを決めた時にd-iZe兄さんが口にした一言！<br>','36103009','2015-02-12 11:02:47','2015-10-29 11:12:09','00:02:55'),(6,'飛べない豚はただの豚だ','AKB48さんのラブラドール・レトリバーを演奏しているわしゅうの姿が紅の豚の主人公に似ているというツイートが読まれ、わしゅうが放った一言です(笑)<br>\r\n<br>\r\n直後にジョニーさんが『「歌えない豚は」じゃないんだそこはw』というツッコミを入れています！','52063067','2015-02-12 18:43:49','2015-10-29 11:11:46','01:38:00'),(8,'季節は、春夏キンモクセイ秋冬！','ハウスメイトさんの『秋だなーって感じる瞬間を教えてください』という質問に対して出た汀ちゃんの名言です！','10090001','2015-02-21 04:31:11','2015-10-29 11:08:24','00:40:00'),(9,'#goose7を付けると我々のものに！','まなみさんがUstream放送がTwitterと連動していることを伝える時に言い間違えた名言！<br>\r\n<br>\r\nその直後に、ジョニーさんが『我が物にするのだぁ』、工藤さんが『世界征服を』などと言っているシーン含めて何度観ても笑いが止まりませんので紹介します。','54137147','2015-02-21 04:57:06','2015-10-29 11:07:57','00:18:40'),(12,'リベンジしたいんです！途中で切れたらしいんです。','2012年11月頃にスピンオフ放送という予告無し&アーカイブやYouTube無しのUstream放送を行ったことがあります。<br><br>\r\nその時にHYさんの「366日」を演奏したんですけど、途中で放送が切れてしまうというハプニングがありました。<br><br>\r\nそういった出来事があって、2013年1月放送でのリベンジ演奏が実現したのです！<br><br>\r\nこの言葉は、演奏前にd-iZeさんが言った言葉です。','28627761','2015-03-26 11:59:02','2015-10-29 11:02:25','01:06:30'),(13,'起きたくないよぉ...起きてたぁ！','ゲストの片平里菜ちゃんの朝起きれないという悩みに対してハウスメイトさんからのアドバイスを工藤さんが実践してみた時の『起きたくないよぉ』ダンスがおもしろかったです！','41941980','2015-10-29 11:10:57','2015-10-29 11:10:57','01:27:45');
